import React, { Suspense, useState, useEffect } from "react";
import axios from "axios";
import { reactLocalStorage } from "reactjs-localstorage";
import * as API from "../API";
import { useStateValue } from "../StateProvider";
import * as cC from "./category/categoryController";
import { useParams } from "react-router";

let texono = [];
export let taxonomy = [];
export let allProducts = [];

const resource = {
  user: [{ name: "a" }, { name: "b" }, { name: "c" }, { name: "d" }],
  posts: [
    { id: 1, text: "ss" },
    { id: 2, text: "nnn" },
    { id: 3, text: "ttt" },
    { id: 4, text: "uuu" },
  ],
};

export default function Test() {
  const [myProducts, setMyProducts] = useState([]);
  let url = "";
  const params = useParams();
  if (params) {
    url = params.url;
  }

  let urlData = cC.getUrlTaxonomy(url);

  return <ProfileTimeline urlData={urlData} setMyProducts={setMyProducts} />;
}

function ProfileDetails() {
  // Try to read user info, although it might not have loaded yet
  return <h1>{resource.user.name}</h1>;
}
const loadProducts = async (dispatch, category, setMyProducts) => {
  let apiUrl =
    "http://localhost:8500/celerant360/server/CF/API.cfc?method=getAllProducts&property=sortby&caturl=firearms&taxonomy=DEPT&category=" +
    category;

  let data = [];
  axios.get(apiUrl).then((response) => {
    data = response.data;
    console.log(data);
    if (response.data.includes("table.cfdump_wddx")) {
      data = [];
    }
    alert("reached");
    console.log(data);
    setMyProducts(data);
    dispatch({
      type: "LOADING_STATUS",
      laoder: false,
    });
  });
};
function ProfileTimeline(props) {
  const [
    { loading, allProductsData, sFilters, sortby },
    dispatch,
  ] = useStateValue();

  useEffect(() => {
    alert(props.urlData.category);
    loadProducts(dispatch, props.urlData.category, props.setMyProducts);
  }, [props.urlData.category]);

  alert("above html");
  return (
    <ul>
      {loading == true
        ? "Loading ---"
        : allProductsData.map((post) => (
            <li key={post.STYLE_ID + "werewr"}>{post.STYLE_ID}</li>
          ))}
    </ul>
  );
}
